import React from 'react';
import styles from './BannerBlog.module.scss';
import { useParams } from 'react-router-dom';
const BannerBlog = () =>{
    const params = useParams();
    return(
        <div className={styles.banner}>
            <p>Blogs</p>
            {params.id && <p>{params.id}</p>}
        </div>
    )
}

export default BannerBlog;
